import React from "react";
import { Input } from "@chakra-ui/react";

const Studentreg = () => {
  return (
    <div className=" w-1/2 rounded-lg bg-gray-200 ">
      <div className="h-64  border-black border-0 pt-3 ">
        <div className=" flex justify-center">
          <h1 className="border-1 border-black text-lg justify-center">
            Register Student
          </h1>
        </div>
        <div className="px-32">
          <div className="flex flex-row align-baseline justify-center">
            <h1 className="w-fit">asas</h1>
            <input className="bg-transparent border-2 border-gray-400 rounded-sm"></input>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Studentreg;
